        <FaLinkedin className="icon" /> LinkedIn
      </a>
      <a href="https://github.com/sakshi123509" target="_blank" rel="noopener noreferrer">
        <FaGithub className="icon" /> GitHub
      </a>
      <a href=""></a><button onClick={toggleTheme} className="toggle-btn">
        ðŸŒ™ Toggle
      </button>
    </div>
  );
};

export default SocialBar;
